import React from "react";
import { Text, StyleSheet } from "react-native";
import colors from "../config/colors";

function Title(props) {
  return <Text style={styles.titleStyle}>{props.children}</Text>;
}

function H1(props) {
  return <Text style={styles.h1Style}>{props.children}</Text>;
}

function H2(props) {
  return <Text style={styles.h2Style}>{props.children}</Text>;
}

function H3(props) {
  return <Text style={styles.h3Style}>{props.children}</Text>;
}

function Percent(props) {
  return <Text style={styles.percentStyle}>{props.children}</Text>;
}

const styles = StyleSheet.create({
  titleStyle: {
    color: colors.secondary,
    fontFamily: "Roboto",
    fontStyle: "normal",
    fontWeight: "700",
    fontSize: 48,
    justifyContent: "center",
    alignItems: "center",
  },

  h1Style: {
    color: colors.black,
    fontFamily: "Roboto",
    fontStyle: "normal",
    fontWeight: "700",
    fontSize: 16,
    justifyContent: "center",
    alignItems: "center",
    margin: 5,
  },

  h2Style: {
    color: colors.black,
    fontFamily: "Roboto",
    fontStyle: "normal",
    fontWeight: "400",
    fontSize: 11,
    justifyContent: "center",
    alignItems: "center",
    textAlign: "left",
  },

  h3Style: {
    color: colors.black,
    fontFamily: "Roboto",
    fontStyle: "normal",
    fontWeight: "400",
    fontSize: 16,
    justifyContent: "center",
    alignItems: "center",
    textAlign: "left",
    flex: 1,
  },

  percentStyle: {
    color: colors.black,
    fontFamily: "Roboto",
    fontStyle: "normal",
    fontWeight: "400",
    fontSize: 11,
    justifyContent: "center",
    alignItems: "center",
    textAlign: "left",
    marginTop: 10,
  },
});

export { Title, H1, H2, H3, Percent };
